import React from "react";

export default function AuthModal() {
  return (
    <div
      className="w-screen h-screen absolute top-0 left-0 z-20 flex"
      style={{ backgroundColor: "rgba(0,0,0,.6)" }}
    >
      <div className="border-gray-700 w-full bg-white p-5 mx-4 flex self-center">
        <h1>Login</h1>
        <Input type="text" />
        <Input type="password" />
      </div>
    </div>
  );
}
